import base64

# 带有前缀的 Base64 编码图像字符串
base64_string_with_prefix = "data:image/jpeg;base64,"
# 移除前缀
base64_string = base64_string_with_prefix.split(",")[1]

# 解码 Base64 字符串
image_data = base64.b64decode(base64_string)

# 将解码后的数据写入图片文件
with open("./static/images/decoded_image1.png", "wb") as image_file:
    image_file.write(image_data)
